import React from 'react'
import { UserNav } from '../../component/Navbar/homeNav'
import { useEffect } from 'react';
import OnBoarding from '../../SmartContracts/OnBoarding/OnBoarding';
import { useState } from 'react';

export default function MyMaterials() {

  const [materialsList,SetMaterialsList]=([])

  async function getMaterials(){
    const onboarding = new OnBoarding();
    var mats = await onboarding.getMaterials();
    console.log(mats)
    let result = mats.map((value,key)=>{

      return(<tr key={key}>
              <td key={value.name}>>{value.name}</td>
      </tr>)

    })
    console.log(result)
    SetMaterialsList(result)
  }

  useEffect(()=>{
    getMaterials();
  },[])

  return (
    <div>
        <div className='sign'>
        <UserNav/>
        <h1>My Materials</h1>
        
        </div>

    </div>
  )
}
